(wm);Am(lm);Nm(Wo);if(__INTLIFY_PROD_DEVTOOLS__){const e=Lt();e.__INTLIFY__=!0,pm(e.__INTLIFY_DEVTOOLS_GLOBAL_HOOK__)}const fh="Lars Obist",dh={TITLE:"Welcome"},gh={TITLE:"About me",TEXT:"I am Lars, currently a master's student at the Berlin Institute of Technology (BHT). Among the various areas of media informatics, I am particularly interested in frontend development and design aspects. The work 'behind' the interface, the backend, is also fascinating, as it involves developing an entire project from the ground up, shaping every layer of a project. The combination of creativity and systematic thinking in media informatics is something I find very exciting. At the end of a project, you can see what the project has become, making it enjoyable to develop new projects! I hope you enjoy browsing my portfolio, where you'll learn a lot about me and my created products. I hope you appreciate my work and feel free to get in touch!",EDUCATION:{TITLE:"Education",MASTER:{TITLE:"Master's Degree - Media Informatics M. Sc.",UNI:"Berlin Institute of Technology",TIME:"10/2022 - expected 09/2024"},BACHELOR:{TITLE:"Bachelor's Degree - International Media Informatics B. Sc.",UNI:"Bremen University of Applied Sciences",TIME:"09/2018 - 09/2022"}},EXPERIENCES:{TITLE:"Practical Experiences",BOSCH:{EMPLOYER:"Bosch Digital",JOB:"Student Job",TASKS:"Frontend Development and Consulting",CITY:"Berlin",TIME:"06/2023 - Present"},PLANETMUTLU:{EMPLOYER:"planetmutlu",JOB:"Internship and Student Job",TASKS:"Web Design, Development, and Project Management",CITY:"Bremen",TIME:"03/2021 - 05/2023"}},ABROAD:{TITLE:"International Experiences",STUDY:{TITLE:"Study Abroad Semester",PLACE:"SeoulTech University, Seoul, South Korea",TIME:"08/2021 - 12/2021"},WORKANDTRAVEL:{TITLE:"Work and Travel",PLACE:"Australia and New Zealand",TIME:"10/2017 - 05/2018"}}},mh={TITLE:"Skills",LANGUAGES:{TITLE:"Programming Languages"},FRAMEWORKS:{TITLE:"Frameworks"},SOFTWARE:{TITLE:"Software"},METHODS:{TITLE:"Methods"}},hh={TITLE:"Projects",ZPHERE:{TITLE:"zphere",CATEGORY:"Bachelor Project",DESCRIPTION:"Zphere is a sports platform that depicts sports that have been poorly represented in the media. It aims to provide fans interested in such sports with a centralized online platform. Through a collaboration between the university and Radio Bremen, we had the opportunity to prototype this idea as part of our bachelor project. The web app's functionality and content were defined in the concept phase by our group. To further define the platform, we conducted sports and target audience identification. During the implementation phase, we performed a competitive analysis, created mood boards, and designed the platform's branding. In the design development, wireframes were initially designed and later defined more precisely by me and Yuliya Litvin using Adobe XD. Meanwhile, the rest of the team developed a prototype."},CIRCLEOFLIFE:{TITLE:"Circle of Life",CATEGORY:"Data Visualization",DESCRIPTION:'"Circle of Life" is an interactive website that focuses on visually representing complex datasets through various visualizations, making them engaging for end-users and highlighting interesting topics. This site features a dataset of birth dates collected over 21 years in the USA. Special emphasis was placed on interaction possibilities, allowing users to obtain more information about data points. In designing the interface, I aimed for minimalism but also incorporated the relatively new technique of variable fonts, allowing user interaction.'},TRAVELBUCKET:{TITLE:"TravelBucket",CATEGORY:"Programming",DESCRIPTION:"During the studies, various mobile apps were developed, covering different aspects of mobile development. Experience in cross-platform mobile app development was gained by creating simple apps with Flutter and React Native. Apps with SwiftUI and Kotlin were also developed for various use cases, such as accessing smartphone sensors or creating a travel plan. An AR app was developed, placing various 3D objects in space. Almost every application has an API interface. Using the OpenWeather API, a modern application was developed in this context. Within the links you will find documents for TravelBucket"},BACHELORTHESIS:{TITLE:"Bachelor Thesis",CATEGORY:"Scientific Work",DESCRIPTION:"In an increasingly digital world, websites are a significant tool for companies, organizations, and individuals. They are essential for establishing an online presence and enabling digital education to take place fully. This bachelor thesis involved conceptualizing and evaluating a digital hybrid teaching model, using the example of an interactive learning environment for cultural education institutions. An in-depth requirements analysis was conducted, and important foundations were established. Based on the previous results, a detailed concept of a hybrid teaching model and a digital learning management system were developed. The concept was then prototypically implemented, evaluated with test users, and finally assessed."},CULINO:{TITLE:"Culino",CATEGORY:"Fullstack Web Application",DESCRIPTION:`"Culino" is a full-stack app where users can share their favorite recipes on a reputable and visually appealing platform, allowing other food enthusiasts to experience their favorite recipes. At the project's inception, a concept for the project idea was developed, on which the branding was subsequently built. Finally, the application was prototypically developed and filled with content.`},USABILITY:{TITLE:"Usability Engineering",CATEGORY:"Analysis",DESCRIPTION:"In the module 'Usability Engineering,' important aspects of user-friendly navigation were explained through various exercises. Fundamentals were taught through analyses and elaborations on an example product. The importance of statistically processing experiments was also emphasized. I conducted this using the Ryanair website, where I performed a usability experiment and subsequently created a concept for improvements. Finally, another problem area was selected, where a detailed analysis and a potential experiment were designed."},LAGOM:{TITLE:"Lagom",CATEGORY:"Data-Based Web Application",DESCRIPTION:'"LAGOM" is a digital bullet journal that offers users a way to structure and organize their lives in a personal and individual workspace using reminders, to-do lists, and more. The application is designed to update data stored in a database in the browser as soon as new entries are modified. Thao Nguyen, Yuliya Litvin, and I developed the entire web application together, with each contributing to all parts of the project.'},BUILDAR:{TITLE:"buildAR",CATEGORY:"Prototyping & Study",DESCRIPTION:'Together with Moumita Ahmad and Tabea Schuster, I analyzed alternatives to traditional paper instructions through the project "buildAR." In an era of technological progress and digitization, instructions, whether for games or furniture, have changed very little. This motivated us to analyze options for modernizing instructions. In a user test, we compared two prototype instructions against traditional paper instructions and analyzed the results using a questionnaire. The documentation provides a detailed account of our approach and the findings of the user test.'},RUNNERSHIGH:{TITLE:"Runners High",CATEGORY:"Animation Video",DESCRIPTION:`In collaboration with Tabea Schuster, I developed an animation video on the topic of "Runner's High." We followed a systematic approach by first sketching and designing the content of the short video within a storyboard. Subsequently, we designed and perfected the video in cycles using Adobe After Effects. You can view the animation video on Vimeo through the following link.`},TIMELESSTREASURES:{TITLE:"Timeless Treasures",CATEGORY:"Fullstack Web Application",DESCRIPTION:'"Timeless Treasures" is a full-stack app that allows users to bring their jewelry to the secondhand market, giving new life to necklaces, rings, and watches. At the beginning of the project, a problem analysis was developed for a project idea. The potential value of this application was then presented to startup enthusiasts through a presentation. Finally, the application was prototypically developed and filled with content.'},WEBGAMES:{TITLE:"Web Games",CATEGORY:"Jump'n'Run and Point & Click Web Games",DESCRIPTION:`During my bachelor's studies, I, along with Thao Nguyen, Moumita Ahmad, and Yuliya Litvin, developed two games to explore the game development aspect of media informatics. One game is a Point and Click Adventure developed only with HTML, JavaScript, and CSS. This game is titled "Last Minute!" and revolves around a student stressed in the final stages of their bachelor's thesis. The player assists the protagonist in successfully submitting the thesis to the professor. The second developed game is called "Throwback." Throwback is a Jump & Run game where the protagonist travels through the last century, prompted by the grandmother's claim that things were better in the past. The game was designed and programmed using Tiled and Phaser 3.`},SAVEATURTLE:{TITLE:"Save a Turtle",CATEGORY:"First Website",DESCRIPTION:"At the beginning of the first semester, I designed an information-based website. The website informs visitors about sea turtles and their threats. It also provides a gallery and links to partners where money can be donated to help the turtles. Additionally, there is information about a partner program where one can sign up as a sponsor for a sea turtle."},EATABROAD:{TITLE:"eatabroad",CATEGORY:"Design and Web Development",DESCRIPTION:"Sometimes, it's worth deviating from the beaten tourist paths and exploring unfamiliar places. These lesser-known travel destinations not only offer an escape from the crowds but also provide an opportunity to discover new culinary delights and immerse oneself in the local culture. Together with Thao Nguyen, we created a platform that showcases food specialties from around the world, closely tied to noteworthy locations. Once the design concept was established, we initiated the design process. The hand-drawn wireframes were later refined in Adobe XD and then prototypically programmed using HTML, CSS, and JavaScript. This platform was developed to be optimized for web, tablet, and mobile devices."},ESHOP:{TITLE:"ESHOP YTL",CATEGORY:"Java Application",DESCRIPTION:"ESHOP YTL is a small online shop developed in collaboration with Thao Nguyen and Yuliya Litvin. Customers and employees have their own accounts with different rights. When not logged in, users can view all items. Once logged in, a customer can add items to the shopping cart, edit it, and make purchases. After a purchase, the customer receives an invoice. A logged-in employee can view and add users, add new items, increase the stock of an item, and view the entire history of all items as well as an individual item's history. We created the E-Shop with a graphical user interface that runs on a server, allowing multiple users to use the E-Shop simultaneously."},PORTFOLIO:{TITLE:"Design Portfolio",CATEGORY:"Design Work",DESCRIPTION:"In design, I have worked on many different smaller projects. For example, I have done retouching multiple times, redesigned logos and websites, or edited images using Lightroom. All of these works are summarized in a portfolio that showcases these projects."},UPCOMING:{TITLE:"Upcoming Projects",CATEGORY:"Analysis",DESCRIPTION:"Currently, I am involved in another interesting project. In the master project, we are developing a live streaming platform with various AI models in a group of 10 people. Speech-to-text functionality and object recognition are to be integrated. In this project, I work as a Scrum Manager, assisting my team members when needed. Additionally, I will start my master's thesis in April 2024, focusing on data visualization."}},ph={TITLE:"Project Details",DOCU:"Documentation",GITHUB:"Code",LIVEDEMO:"Checkout Project",CLOSE:"Close"},_h="Way to contact me",Eh="Settings",Th="Light",Lh="Dark",Ih="GER",bh="ENG",Sh={LARSOBIST:fh,HEADER:dh,ABOUT:gh,SKILLS:mh,PROJECTS:hh,DETAIL:ph,GETINCONTACT:_h,SETTINGS:Eh,LIGHTMODE:Th,DARKMODE:Lh,GERMAN:Ih,ENGLISH:bh},Oh="Lars Obist",vh={TITLE:"Willkommen"},Ah={TITLE:"Über mich",TEXT:'Ich bin Lars und bin aktuell Masterstudent an der Berliner Hochschule für Technik (BHT). Von den vielen verschiedenen Themengebieten der Medieninformatik interessiert mich besonders die Arbeit im Frontend und die gestalterischen Aspekte. Die Arbeit "hinter" der Oberfläche, das Backend, ist ebenfalls sehr spannend, da dort ein gesamtes Projekt von Grund auf entwickelt wird und dabei jede Schicht eines Projekts entwickelt wird. Den Mix aus dem Kreativen und dem Systematischen in der Medieninformatik finde ich sehr spannend. Am Ende des Projektes sieht man, wozu sich das Projekt entwickelt hat, weshalb es immer wieder Spaß macht, ein neues Projekt zu entwickeln! Ich wünsche viel Spaß beim Durchschauen meines Portfolios, in dem Sie viel über mich und meine erstellten Produkte lernen werden. Ich hoffe, Sie finden Gefallen an meinen Arbeiten, und melden sich bei mir!',EDUCATION:{TITLE:"Bildungsweg",MASTER:{TITLE:"Masterstudium - Medieninformatik M. Sc.",UNI:"Berliner Hochschule für Technik",TIME:"10/2022 - vsl. 09/2024"},BACHELOR:{TITLE:"Bachelorstudium - Internationaler Studiengang Medieninformatik B. Sc.",UNI:"Hochschule Bremen",TIME:"09/2018 - 09/2022"}},EXPERIENCES:{TITLE:"Praktische Erfahrungen",BOSCH:{EMPLOYER:"Bosch Digital",JOB:"Werkstudentenjob",TASKS:"Frontend Development und Consulting",CITY:"Berlin",TIME:"06/2023 - heute"},PLANETMUTLU:{EMPLOYER:"planetmutlu",JOB:"Praktikum und Werkstudentenjob",TASKS:"Webdesign, Entwicklung und Projektmanagement",CITY:"Bremen",TIME:"03/2021 - 05/2023"}},ABROAD:{TITLE:"Auslandserfahrungen",STUDY:{TITLE:"Auslandssemester",PLACE:"SeoulTech University, Seoul, Südkorea",TIME:"08/2021 - 12/2021"},WORKANDTRAVEL:{TITLE:"Work and Travel",PLACE:"Australien und Neuseeland",TIME:"10/2017 - 05/2018"}}},Nh={TITLE:"Skills",LANGUAGES:{TITLE:"Programmiersprachen"},FRAMEWORKS:{TITLE:"Frameworks"},SOFTWARE:{TITLE:"Software"},METHODS:{TITLE:"Methoden"}},Ch={TITLE:"Projekte",ZPHERE:{TITLE:"zphere",CATEGORY:"Bachelorprojekt",DESCRIPTION:`zphere ist eine Sportplattform, die medial bisher schlecht repräsentierte Sportarten abbildet und den Fans, die sich für solche Sportarten interessieren, einen gesammelten Ort in Form einer Onlineplattform geben soll.



Durch eine Kooperation zwischen der Hochschule und Radio Bremen ergab sich die Möglichkeit, diese Idee prototypisch im Rahmen unseres Bachelorprojektes zu konzipieren und zu entwickeln. Wie diese Web-App funktionieren und welche Inhalte sie beinhalten soll, haben wir als Gruppe in der Konzeption definiert. Um die Plattform genauer zu definieren, haben wir im Anschluss eine Sportartenfindung und eine Zielgruppenfindung durchgeführt. Als es um die Realisierung ging, führten wir eine Konkurrenzanalyse durch, entwickelten Moodboards und designten das Branding der Plattform. Bei der Designentwicklung wurden zunächst Wireframes entworfen, die im Anschluss von mir und Yuliya Litvin mithilfe von Adobe XD genauer definiert wurden. Währenddessen entwickelte der Rest des Teams einen Prototyp.`},CIRCLEOFLIFE:{TITLE:"Circle of Life",CATEGORY:"Datenvisualisierung",DESCRIPTION:`"Cirlce of Life" ist eine interaktive Webseite, die sich damit beschäftigt, komplexe Datensätze durch unterschiedliche Visualisierungen für den Endnutzer spannend zu visualisieren und interessante Themen hervorzuheben. 
Diese Seite hat einen Datensatz zu Geburtsdaten, welcher über 21 Jahre in den USA zusammengetragen wurde.
Ein spezielles Augenmerk sollte auf den Interaktionsmöglichkeiten liegen, über die man mehr Informationen zu dem Datenpunkt erhalten kann.  Beim Entwickeln des Designs habe ich versucht, so minimalistisch wie möglich vorzugehen. Es wurde jedoch auch die recht neue Technik einer variablen Fonts eingesetzt, mit welcher der Nutzer interagieren kann.`},TRAVELBUCKET:{TITLE:"TravelBucket",CATEGORY:"Programmierung",DESCRIPTION:`Während des Studiums wurden verschiedene Mobile Apps entwickelt, welche verschiedener Aspekte der mobilen Entwicklung beinhaltet haben. Durch die Erstellung einfacher Apps mit Flutter und React Native wurden weitere Erfahrungen mit plattformübergreifender Entwicklung mobiler Apps gesammelt. Ebenfalls wurden Apps mit SwiftUI und Kotlin für verschiedenste Anwendungsfälle entwickelt. Es wurden Apps entwickelt, welche beispielsweise auf die Sensoren des Smartphones zugreifen, oder welche wo ein Reiseplan erstellt werden konnte.

Ebenfalls wurde eine AR App entwickelt, wo verschiedene 3D Objekte in dem Raum platziert wurden. Praktisch jede Anwendung besitzt eine Schnittstelle zu einer API. Auch hier haben wir mithilfe der OpenWeather API eine moderne Anwendung entwickelt. In den Links finden Sie Dokumente für das TravelBucket Projekt.`},BACHELORTHESIS:{TITLE:"Bachelorarbeit",CATEGORY:"Wissenschaftliche Arbeit",DESCRIPTION:"In einer immer digitaleren Welt sind Websites ein bedeutsames Hilfsmittel für Unternehmen, Organisationen und Einzelpersonen. Einerseits um ihre Präsenz im Internet zu etablieren und andererseits für Bildungsinstitutionen, um digitalen Unterricht volljährig stattfinden zu lassen. Im Rahmen dieser Bachelorarbeit wurde eine Konzeption und Evaluation eines digitalen hybriden Lehrmodells am Beispiel einer interaktiven Lernumgebung für kulturelle Bildungseinrichtungen ausgearbeitet. Es wurde eine intensive Anforderungsanalyse durchgeführt und wichtige Grundlagen festgelegt. Basierend auf den vorherigen Ergebnissen wurde eine detaillierte Konzeption eines hybriden Lehrmodells und eines digitalen Lernmanagementsystems entwickelt. Die Konzeption wurde abschließend prototypisch umgesetzt und final mithilfe von Testnutzern ausgewertet und abschließend bewertet."},CULINO:{TITLE:"Culino",CATEGORY:"Fullstack Webanwendung",DESCRIPTION:`"Culino" ist eine Fullstack-App, bei der Nutzer ihre Lieblingsrezepte auf einer seriösen und visuell ansprechenden Plattform teilen können und somit den anderen Essensenthusiasten ihre Lieblingsrezepte teilhaben lassen.

Zu Beginn des Projekts wurde ein Konzept für die Projektidee entwickelt, auf dem das Branding anschließend aufbaute. Abschließend wurde die Anwendung prototypisch entwickelt und mit Inhalt gefüllt.`},USABILITY:{TITLE:"Usability Engineering",CATEGORY:"Analyse",DESCRIPTION:"In dem Modul „Usability-Engineering“ wurden anhand verschiedenster Übungsaufgaben wichtige Aspekte einer nutzerfreundlichen Nutzerführung erläutert. Zunächst wurden die Grundlagen anhand von Analysen und Ausarbeitungen an einem Beispielprodukt gelehrt. Ebenfalls wurde die Wichtigkeit der statistischen Ausarbeitung von Experimenten beigebracht. Ich habe dies mithilfe der Ryanair-Webseite gemacht und hierfür ein Usability-Experiment durchgeführt und anschließend ein Konzept für Verbesserungen erstellt. Abschließend wurde ein weiteres Problemfeld ausgesucht, an dem eine detaillierte Analyse und ein potenzielles Experiment designt wurden."},LAGOM:{TITLE:"Lagom",CATEGORY:"Datenbasierte Webanwendung",DESCRIPTION:'"LAGOM" ist ein digitaler Bullet Journal, der Nutzern anbietet sein Leben in einem persönlichen und individuellen Workspace, anhand von Erinnerungen, ToDo-Listen und mehr, zu strukturieren und organisieren. Die Anwendung ist so entwickelt, dass sich die Daten, welche auf einer Datenbank gespeichert sind, in dem Browser aktualisieren, sobald neue Einträge verändert wurden. Die gesamte Webanwendung haben Thao Nguyen, Yuliya Litvin und ich zusammen entwickelt, womit jeder an allen Teilen des Projekts beteiligt war.'},BUILDAR:{TITLE:"buildAR",CATEGORY:"Prototyping & Studie",DESCRIPTION:'Ich habe mithilfe von Moumita Ahmad und Tabea Schuster anhand des Projektes "buildAR" analysiert, welche Alternativen es zu der etablierten Papieranleitung gibt. In Zeiten der des technologischen Fortschrittes und der Digitalisierung hat sich die Anleitung, ob sie für Spiele oder Möbel sind, aber kaum verändert. Dies hat uns dazu motiviert, zu analysieren, welche Optionen es die Modernisierung der Anleitungen gibt. In einem Nutzertest haben wir zwei prototypische Anleitungen gegen die Papieranleitung getestet und mithilfe eines Fragebogens analysiert. In der Dokumentation können Sie nachvollziehen, wie wir exakt vorgegangen sind und was der Nutzertest ergeben'},RUNNERSHIGH:{TITLE:"Runners High",CATEGORY:"Animationsvideo",DESCRIPTION:`Gemeinsam mit Tabea Schuster habe ich zu dem Thema "Runner's High" ein Animationsvideo entwickelt. Dabei sind wir systematisch vorgegangen, indem wir zunächst den Inhalt des Kurzvideos innerhalb eines Storyboards skizziert und entworfen haben. Im Anschluss haben wir in Zyklen das Video innerhalb von Adobe After Effects entworfen und perfektioniert. Über folgenden Link können Sie das Animationsvideo auf Vimeo ansehen.`},TIMELESSTREASURES:{TITLE:"Timeless Treasures",CATEGORY:"Fullstack Webanwendung",DESCRIPTION:`"Timeless Treasures" ist eine Fullstack-App, bei der Nutzer mithilfe dieser Anwendung ihren Schmuck auf den Secondhandmarkt bringen können und somit den Ketten, Ringen und Uhren ein neues Leben einhauchen.

Zu Beginn des Projekts wurde eine Problemanalyse für eine Projektidee entwickelt, anschließend der potenzielle Mehrwert dieser Anwendung anhand einer Präsentation vor Start-up-Entdeckern gehalten. Abschließend wurde die Anwendung prototypisch entwickelt und mit Inhalt gepflegt.`},WEBGAMES:{TITLE:"Web Games",CATEGORY:"Jump'n'Run und Point & Click Webspiele",DESCRIPTION:'In dem Bachelorstudium habe ich zusammen mit Thao Nguyen, Moumita Ahmad und Yuliya Litvin zwei Spiele entwickelt, um auch diese Seite der Medieninformatik kennenzulernen. Ein Spiel ist ein Point und Click Adventure, welches nur mit HTML, JavaScript und CSS entwickelt wurde. Dieses Spiel trägt den Namen "Last Minute!", da es um einen Studenten geht, der gestresst in den letzten Zügen seiner Bachelorarbeit steckt. Der Spieler hilft dem Protagonisten dabei, die Bachelorarbeit erfolgreich in dem Fach seines Professors abzugeben. Das zweite entwickelte Spiel heißt "Throwback". Throwback ist ein Jump & Run Spiel, in dem der Protagonist eine Zeitreise durch das letzte Jahrhundert macht, da die Oma erneut behauptet hat, dass früher alles besser gewesen sei. Das Spiel wurde mit Tiled und Phaser 3 entworfen und programmiert.'},SAVEATURTLE:{TITLE:"Save a Turtle",CATEGORY:"Erste Webseite",DESCRIPTION:"Zu Beginn des ersten Semesters habe ich eine informationsbasierte Webseite entworfen. Die Webseite informiert die Besucher über die Meeresschildkröten und deren Bedrohung. Sie bietet zudem eine Galerie sowie den Verweis auf Partner an, bei denen Geld gespendet werden kann, um den Tieren zu helfen. Ebenfalls wird dort auf einen Partner hingewiesen, bei dem man sich als Pate einer Meeresschildkröte anmelden kann."},EATABROAD:{TITLE:"eatabroad",CATEGORY:"Design und Webentwicklung",DESCRIPTION:"Manchmal lohnt es sich, von ausgetretenen Touristenpfaden abzuweichen und unbekannte Orte zu erkunden. Diese weniger bekannten Reiseziele bieten nicht nur eine Flucht vor den Massen, sondern auch die Gelegenheit, neue kulinarische Genüsse zu entdecken und sich in die lokale Kultur einzutauchen. Zusammen mit Thao Nguyen haben wir eine Plattform, die Essensspezialitäten aus der gesamten Welt vorstellt. Dabei werden die Spezialitäten eng an sehenswerte Orte gebunden. Als das Designkonzept festgelegt wurde, haben wir mit dem Designprozess begonnen. Die gezeichneten Wireframes wurden im Anschluss in Adobe XD verfeinert und im Anschluss prototypisch mit HTML, CSS und JavaScript programmiert. Diese Plattform wurde für Web, Tablet und Handy optimiert entwickelt."},ESHOP:{TITLE:"ESHOP YTL",CATEGORY:"Java Anwendung",DESCRIPTION:"ESHOP YTL ist ein kleiner Online-Shop, welcher zusammen mit Thao Nguyen und Yuliya Litvin entwickelt wurde. Kunden und Mitarbeiter haben eigene Accounts, aber unterschiedliche Rechte. Nicht eingeloggt, können Sie alle Artikel einsehen. Eingeloggt kann der Kunde Artikel in den Warenkorb hinzufügen, diesen bearbeiten und Artikel kaufen. Nach einem Kauf erhält dieser eine Rechnung. Ein eingeloggter Mitarbeiter kann Benutzer einsehen und neue hinzufügen. Dieser kann auch neue Artikel hinzufügen und den Bestand eines Artikels erhöhen, sowie die gesamte Historie aller Artikel, wie auch eines einzelnen Artikels, einsehen. Wir haben den E-Shop mit einer grafischen Benutzeroberfläche erstellt, der über einen Server läuft. Dies ermöglicht, dass mehrere Nutzer gleichzeitig den E-Shop nutzen können."},PORTFOLIO:{TITLE:"Design Portfolio",CATEGORY:"Gestaltungsarbeiten",DESCRIPTION:"In der Gestaltung habe ich an vielen verschiedenen kleineren Projekten gearbeitet. Beispielsweise habe ich mehrmals Retuschen gemacht, ein Redesign von Logo und Webseite vollzogen oder mithilfe von Lightroom Bilder bearbeitet. All diese Arbeiten finden Sie in einem Portfolio, welches all diese Projekte zusammenfasst."},UPCOMING:{TITLE:"Kommende Projekte",CATEGORY:"Analyse",DESCRIPTION:"Aktuell befinde ich mich in einem weiteren interessanten Projekt. In dem Masterprojekt entwickeln wir aktuell in einer Gruppe von 10 Personen eine Livestreaming-Plattform mit verschiedenen KI-Modellen. Zum einen soll eine Speech-To-Text-Funktionalität und eine Objekterkennung eingebunden werden. Hierbei arbeite ich als Scrum Manager und helfe meinen Teammitgliedern bei Bedarf. Im April 2024 starte ich zudem meine Masterthesis, welche sich mit der Datenvisualisierung befassen wird."}},Rh={TITLE:"Projektdetails",DOCU:"Dokumentation",GITHUB:"Code",LIVEDEMO:"Projekt Ansehen",CLOSE:"Schließen"},yh="Kontaktmöglichkeiten",Ph="Einstellungen",Mh="Hell",wh="Dunkel",kh="DEU",Dh="ENG",Fh={LARSOBIST:Oh,HEADER:vh,ABOUT:Ah,SKILLS:Nh,PROJECTS:Ch,DETAIL:Rh,GETINCONTACT:yh,SETTINGS:Ph,LIGHTMODE:Mh,DARKMODE:wh,GERMAN:kh,ENGLISH:Dh},Uh=eh({locale:"de",fallbackLocale:"en",legacy:!1,globalInjection:!0,messages:{en:Sh,de:Fh}}),vr=bc(pg);vr.use(Ac());vr.use(Uh);vr.mount("#app");
